@Test public void testIntersect() {
  final Employee[] emps2 = {
      new Employee(150, "Theodore", 10),
      emps[3],
  };
  assertThat(
      Linq4j.asEnumerable(emps)
          .intersect(Linq4j.asEnumerable(emps2), false)
          .count(),
      is(1));
}

